#
# TABLE STRUCTURE FOR: book
#

DROP TABLE IF EXISTS `book`;

CREATE TABLE `book` (
  `ID` int(11) NOT NULL AUTO_INCREMENT,
  `name` text NOT NULL,
  `description` text NOT NULL,
  `author` text NOT NULL,
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: review
#

DROP TABLE IF EXISTS `review`;

CREATE TABLE `review` (
  `ID` int(11) NOT NULL AUTO_INCREMENT,
  `rating` tinyint(4) NOT NULL,
  `description` text NOT NULL,
  `user_id` int(11) NOT NULL,
  `book_id` int(11) NOT NULL,
  `transaction_id` int(11) NOT NULL,
  PRIMARY KEY (`ID`),
  KEY `point_to_book` (`book_id`),
  KEY `point_to_user` (`user_id`),
  KEY `point_to_transaction` (`transaction_id`),
  CONSTRAINT `point_to_book` FOREIGN KEY (`book_id`) REFERENCES `book` (`ID`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `point_to_transaction` FOREIGN KEY (`transaction_id`) REFERENCES `transaction` (`ID`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `point_to_user` FOREIGN KEY (`user_id`) REFERENCES `user` (`ID`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=151 DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: transaction
#

DROP TABLE IF EXISTS `transaction`;

CREATE TABLE `transaction` (
  `ID` int(11) NOT NULL AUTO_INCREMENT,
  `date` date NOT NULL,
  `user_id` int(11) NOT NULL,
  `book_id` int(11) NOT NULL,
  `nb_of_books` int(11) NOT NULL,
  PRIMARY KEY (`ID`),
  KEY `to_user` (`user_id`),
  KEY `to_book` (`book_id`),
  CONSTRAINT `to_book` FOREIGN KEY (`book_id`) REFERENCES `book` (`ID`) ON DELETE CASCADE,
  CONSTRAINT `to_user` FOREIGN KEY (`user_id`) REFERENCES `user` (`ID`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=201 DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: user
#

DROP TABLE IF EXISTS `user`;

CREATE TABLE `user` (
  `ID` int(11) NOT NULL AUTO_INCREMENT,
  `email` text NOT NULL,
  `password` text NOT NULL,
  `address` text NOT NULL,
  `username` varchar(20) NOT NULL,
  `name` text NOT NULL,
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=latin1;



